import React from 'react';

class AddUser extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: [
                {
                    id: 1,
                    firstName: 'Bob',
                    lastName: 'Marley',
                    bio: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Repellat, obcaecati.',
                    age: 40,
                    isHappy: true,
                },
                {
                    id: 2,
                    firstName: 'John',
                    lastName: 'Doe',
                    bio: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Repellat, obcaecati.',
                    age: 22,
                    isHappy: false,
                },
            ]
        }
    }
    render() {
        return (
            <form>
                <input type="text" placeholder='Имя'/>
                <input type="text" placeholder='Фамилия'/>
                <textarea name="Биография" id="bio" cols="30" rows="5" placeholder='Биография'></textarea>
                <input type="text" placeholder='Возраст'/>
                <label htmlFor="isHappy">Счастив?</label>
                <input type="checkbox" id='isHappy' placeholder='Имя'/>
                <button type='button'>Добавить</button>
            </form>
        )
    }
}

export default AddUser;
